"use strict";(self.webpackChunkkywk_moco=self.webpackChunkkywk_moco||[]).push([[6146],{9780:function(t){t.exports=JSON.parse('{"blogPosts":[{"id":"/2022/07/01/give-up-github","metadata":{"permalink":"/moco/news/2022/07/01/give-up-github","source":"@site/news/2022/07-01-give-up-github.md","title":"Give up GitHub ?","description":"2022.07.01 Time to give up GitHub?","date":"2022-07-01T00:00:00.000Z","formattedDate":"2022\u5e747\u67081\u65e5","tags":[{"label":"github","permalink":"/moco/news/tags/github"},{"label":"foss","permalink":"/moco/news/tags/foss"}],"readingTime":1.595,"hasTruncateMarker":false,"authors":[{"name":"kywk","title":"Site Maintainer","url":"https://github.io/kywk","imageURL":"https://github.com/kywk.png","key":"kywk"}],"frontMatter":{"title":"Give up GitHub ?","description":"2022.07.01 Time to give up GitHub?","authors":"kywk","tags":["github","foss"],"image":"https://i.imgur.com/mErPwqL.png","hide_table_of_contents":true},"nextItem":{"title":"GitHub Copilot GA","permalink":"/moco/news/2022/06/24/github-copilot"}},"content":"[Give Up GitHub: The Time Has Come! - Conservancy Blog - Software Freedom Conservancy](https://sfconservancy.org/blog/2022/jun/30/give-up-github-launch/) \\n\u662f\u4eca\u5929\u4e0a [Hacker News \u7684\u71b1\u9580\u8a0e\u8ad6](https://news.ycombinator.com/item?id=31932250).\\n\u901a\u7bc7\u4f86\u8aaa, \u652f\u6301\u53cd\u5c0d\u6216\u4e2d\u7acb\u5e7e\u65b9\u7684\u8a0e\u8ad6, \u597d\u50cf\u9084\u662f\u56de\u5230 Vim V.S Emacs \u4e4b\u985e\u7684\u4fe1\u4ef0\u4e4b\u722d.\\n\\n\u524d\u4e9b\u65e5\u5b50, GitHub \u6beb\u4e0d\u610f\u5916\u5730[\u516c\u544a\u4e86 Atom \u9000\u5834](https://github.blog/2022-06-08-sunsetting-atom/),\\n\u8fd1\u65e5 GitHub \u53c8\u63a8\u51fa\u4e86\u53ef\u80fd\u6709\u7248\u6b0a\u7591\u616e\u7684\u6536\u8cbb\u670d\u52d9 GitHub Copilot,\\n\u76f8\u4fe1\u9019\u4e9b\u8209\u52d5\u6703\u8e29\u5230 FOSS \u57fa\u790e\u6559\u7fa9\u6d3e\u652f\u6301\u8005.\\n\\n\u5c0d\u8a31\u591a\u958b\u6e90\u958b\u767c\u8005\u4f86\u8aaa, MS \u4ee3\u8868\u4e86\u539f\u7f6a. \\n\u5373\u4f7f GitHub \u6253\u5f9e\u4e00\u958b\u59cb\u5c31\u8072\u660e GitHub \u662f\u5546\u696d\u516c\u53f8, \u4e0d\u662f\u975e\u71df\u5229\u7d44\u7e54.\\n\u7576\u4ed6\u7368\u7acb\u7d93\u71df\u6642, GitHub \u5c0d\u958b\u767c\u6574\u5408\u5e36\u4f86\u7684\u4fbf\u5229, \u6df1\u53d7\u5404\u65b9\u958b\u767c\u8005\u559c\u597d, \u4e5f\u5305\u62ec FOSS \u5c08\u6848\u8207\u793e\u7fa4. \\n\u800c\u7576 MS \u8cb7\u4e0b GitHub \u5f8c GitHub \u4e00\u8209\u4e00\u52d5\u90fd\u6703\u88ab\u653e\u5927\u6aa2\u8996\u8207\u6279\u8a55.\\n\\n\u500b\u4eba\u66ab\u6642\u662f\u4e2d\u7acb\u504f\u5411\u652f\u6301 GitHub \u7684\u7acb\u5834. \\n\u81ea\u7531\u8edf\u9ad4\u82e5\u80fd\u9069\u7576\u7d50\u5408\u5546\u696d\u884c\u70ba, \u624d\u80fd\u8d70\u5f97\u66f4\u9060.\\n\\nref: [Give Up GitHub - Software Freedom Conservancy](https://sfconservancy.org/GiveUpGitHub/)\\n\\n_22.07.05 update_\\n \\n\u76f8\u95dc\u5f8c\u7e8c\u5831\u5c0e:\\n-   [\u958b\u6e90\u793e\u7fa4\u767c\u8d77\u62b5\u5236\uff01\u5de5\u7a0b\u5e2b AI \u52a9\u624b Github Copilot \u70ba\u4f55\u88ab NGO \u9ede\u540d\uff1f | TechOrange \u79d1\u6280\u5831\u6a58](https://buzzorange.com/techorange/2022/07/05/github-pilot-violate-open-source-non-profit/)\\n-   [\u653e\u68c4 GitHub\uff1a\u6642\u6a5f\u5df2\u5230\uff1fCopilot\u6536\u8cbb\uff0c\u60f9\u6012\u8edf\u9ad4\u81ea\u7531\u4fdd\u8b77\u5354\u6703SFC | T\u5ba2\u90a6](https://www.techbang.com/posts/97658-abandoning-github-the-time-has-come-copilot-charges-a-fee)"},{"id":"/2022/06/24/github-copilot","metadata":{"permalink":"/moco/news/2022/06/24/github-copilot","source":"@site/news/2022/06-24-github-copilot.md","title":"GitHub Copilot GA","description":"2022.06.24 GitHub Copilot GA","date":"2022-06-24T00:00:00.000Z","formattedDate":"2022\u5e746\u670824\u65e5","tags":[{"label":"github","permalink":"/moco/news/tags/github"},{"label":"ai","permalink":"/moco/news/tags/ai"},{"label":"develop","permalink":"/moco/news/tags/develop"}],"readingTime":4.785,"hasTruncateMarker":false,"authors":[{"name":"kywk","title":"Site Maintainer","url":"https://github.io/kywk","imageURL":"https://github.com/kywk.png","key":"kywk"}],"frontMatter":{"title":"GitHub Copilot GA","description":"2022.06.24 GitHub Copilot GA","authors":"kywk","tags":["github","ai","develop"],"image":"https://i.imgur.com/mErPwqL.png","hide_table_of_contents":false},"prevItem":{"title":"Give up GitHub ?","permalink":"/moco/news/2022/07/01/give-up-github"},"nextItem":{"title":"WWDC 2022","permalink":"/moco/news/2022/06/07/wwdc"}},"content":"GitHub Copilot\\n--------------\\n\\n\u9019\u5e7e\u5929\u958b\u767c\u8005\u793e\u7fa4\u6700\u5927\u7684\u65b0\u805e\u61c9\u8a72\u662f GitHub [\u516c\u544a\u6b63\u5f0f\u958b\u653e](https://github.blog/2022-06-21-github-copilot-is-generally-available-to-all-developers/) \\n[GitHub Copilot](https://github.com/features/copilot/).\\nHacker News \u4e0a\u4e5f\u8a0e\u8ad6\u7684\u6cb8\u6cb8\u6d0b\u6d0b: [GitHub Copilot is generally available](https://news.ycombinator.com/item?id=31825742)\\n\\n\u50f9\u9322\u4e5f\u51fa\u4f86\u4e86\uff0cUS$10/mo \u6216\u662f US$100/year\uff1a\\n\\n> We\u2019re making GitHub Copilot, an AI pair programmer that suggests code in your editor, generally available to all developers for $10 USD/month or $100 USD/year. It will also be free to use for verified students and maintainers of popular open source projects.\\n\\n\u66f8\u5beb\u7a0b\u5f0f\u6642, GitHub Copilot AI \u6703\u5373\u6642\u8dd1\u51fa\u5efa\u8b70\u7684\u4fee\u6539\u6216\u662f\u4e0b\u4e00\u884c\u7684\u7de8\u5beb, \u5efa\u8b70\u7684\u8cc7\u8a0a,\\n\u4e0d\u55ae\u662f\u5e7e\u500b\u5b57\u6216\u4e00\u884c\u7a0b\u5f0f, GitHub Copilot \u6703\u4ee5\u6700\u5b8c\u6574\u7684\u89e3\u6c7a\u65b9\u6cd5\u4f86\u5354\u52a9\u958b\u767c\u8005\u89e3\u6c7a\u554f\u984c.\\n\u7121\u8ad6\u662f\u63d0\u4f9b\u6a23\u677f\u7a0b\u5f0f\u78bc, \u6574\u500b\u55ae\u5143\u6e2c\u8a66, \u751a\u81f3\u662f\u66f4\u8907\u96dc\u7684\u6f14\u7b97\u6cd5\u7b49\u3002\\n\\n\\nTabnine\\n-------\\n\\n\u65e9\u4e9b\u5e74\u524d, [Tabnine](https://www.tabnine.com/) \u5c31\u63d0\u4f9b\u4e86\u5229\u7528 AI \u5206\u6790\u7a0b\u5f0f\u78bc\u7684\u81ea\u52d5\u5b8c\u6210\u5de5\u5177.\\n\u50b3\u7d71 IDE \u7684\u81ea\u52d5\u88dc\u5b8c, \u5927\u591a\u662f\u5206\u6790\u7a0b\u5f0f\u78bc\u4e2d\u7684\u8b8a\u6578, \u7269\u4ef6\u5c6c\u6027, \u51fd\u5f0f\u7b49, \u63d0\u4f9b\u5c0d\u61c9\u7684\u81ea\u52d5\u5b8c\u6210\u5efa\u8b70.\\n\\n\u800c Tabnine \u9664\u4e86\u7a0b\u5f0f\u5eab\u4e2d\u7684\u65e2\u6709\u7a0b\u5f0f\u78bc\u7b49\u5206\u6790\u8cc7\u6599\u5916,\\n\u4e5f\u6703\u5229\u7528 AI \u8a13\u7df4\u5206\u6790\u7684\u7d50\u679c, \u63d0\u4f9b\u958b\u767c\u8005\u53ef\u80fd\u6703\u9700\u8981\u7684\u81ea\u52d5\u88dc\u5b8c\u63a8\u85a6. \\n\u9577\u671f\u4f7f\u7528\u4e0b\u4f86, \u89ba\u5f97 Tabnine \u78ba\u5be6\u5c0d\u958b\u767c\u4e0a\u662f\u6709\u5e6b\u52a9\u7684.\\n\\n\u4f46 Tabnine \u4e3b\u8981\u50c5\u63d0\u4f9b\u81ea\u52d5\u5b8c\u6210\u7684\u63a8\u85a6, \u958b\u767c\u4e0a\u9084\u662f\u4e00\u884c\u884c\u81ea\u5df1\u8f38\u5165.\\n\u800c GitHub Copilot \u63d0\u4f9b\u66f4\u591a\u7a0b\u5f0f\u7247\u6bb5, \u53ef\u80fd\u662f\u4e00\u6574\u500b\u529f\u80fd\u5340\u584a\u7a0b\u5f0f\u6a23\u677f\u7b49.\\n\\n\u53ef\u4ee5\u7406\u89e3 GitHub Copilot \u5e36\u4f86\u7684\u4fbf\u5229.\\n\u7562\u7adf\u904e\u5f80\u7d93\u9a57\u4e2d, \u6709\u76f8\u7576\u7a0b\u5ea6\u529f\u80fd\u5340\u584a\u5176\u5be6\u90fd\u975e\u5e38\u96f7\u540c, \\n\u5c24\u5176\u662f\u50cf CRUD / Error Handling / unit test / ... \u7b49\u7a0b\u5f0f\u7247\u6bb5.\\n\u5f88\u591a\u6642\u5019\u958b\u767c\u4e0a\u78ba\u5be6\u662f\u8907\u88fd\u8cbc\u4e0a\u5230\u4e0d\u540c\u5c08\u6848\u800c\u5df2.\\n\\n\\nAmazon CodeWhisperer\\n--------------------\\n\\n\u7121\u7368\u6709\u5076\u5730, \u8fd1\u65e5\u4e9e\u99ac\u905c\u5728 re:Mars \u516c\u5e03\u4e86\u4e00\u6b3e\u540d\u70ba CodeWhisperer \u7684\u81ea\u52d5\u5beb\u7a0b\u5f0f\u8f14\u52a9\u5de5\u5177\u7684\u9810\u89bd\u7248\u672c.\\n\\n\u4e9e\u99ac\u905c\u7684 CodeWhisperer \u662f\u4e00\u7a2e\u80fd\u5354\u52a9\u8edf\u9ad4\u5de5\u7a0b\u5e2b\u64c1\u6709\u66f4\u9ad8\u5beb\u7a0b\u5f0f\u6548\u7387\u7684 AI \u5de5\u5177,\\n\u6839\u64da\u4e9e\u99ac\u905c\u7684\u8aaa\u6cd5\uff0cCodeWhisperer \u5c07\u4e0d\u65b7\u6aa2\u67e5\u5de5\u7a0b\u5e2b\u6240\u5beb\u7684\u7a0b\u5f0f\u78bc, \u4e26\u4e14\u63d0\u4f9b\u6b63\u78ba\u7684\u5efa\u8b70. \\n\\n\\nIssues\\n------\\n\\n### license ###\\n\\n\u76ee\u524d\u9019\u500b\u670d\u52d9\u88ab\u8457\u91cd\u8a0e\u8ad6\u7684\u554f\u984c, \u7b2c\u4e00\u500b\u662f license \u554f\u984c\uff0c\\nHacker News \u4e0a\u6709\u4eba\u63d0\u5230\u6709\u4e9b\u7a0b\u5f0f\u78bc\u7684\u6388\u6b0a\u662f\u6709\u611f\u67d3\u6027\u7684 GPL \u985e\u7684,\\n\u82e5 GitHub Copilot \u81ea\u52d5\u5b8c\u6210\u7684\u7a0b\u5f0f\u7247\u6bb5\u5f15\u7528\u4e86\u9019\u4e9b\u7a0b\u5f0f\u78bc, \u662f\u5426\u9055\u53cd GPL \u898f\u7bc4,\\n\u9019\u662f\u500b\u5168\u65b0\u7684\u554f\u984c, \u5728\u6cd5\u9662\u4e0a\u9084\u6c92\u6709\u88ab\u6230\u904e.\\n\\n### code quality ###\\n\\n\u53e6\u4e00\u500b\u7591\u616e\u662f, \u5b78\u8853\u754c\u91dd\u5c0d Copilot \u7684[\u7814\u7a76\u8ad6\u6587](https://arxiv.org/pdf/2108.09293.pdf)\u6307\u51fa,\\n\u5728 1,689 \u500b\u4f7f\u7528 Copilot \u5efa\u8b70\u7684\u7a0b\u5f0f\u4e2d, \u6709 40% \u7684\u7a0b\u5f0f\u751f\u6210\u7684\u7a0b\u5f0f\u78bc\u5177\u6709\u5df2\u77e5\u7684\u5f31\u9ede.\\n\u800c\u53e6\u4e00\u7bc7\u8ad6\u6587\u5247\u6307\u51fa Github Copilot \u4e8b\u5be6\u4e0a\u52a0\u901f\u4e86\u52a3\u8cea\u7a0b\u5f0f\u78bc\u7684\u7522\u751f.\\n\\n\u6240\u4ee5\u985e\u4f3c\u5de5\u5177\u7684\u4f7f\u7528, \u4ecd\u7136\u5f88\u4f9d\u9760\u5de5\u7a0b\u5e2b\u5c0d\u7a0b\u5f0f\u78bc\u638c\u63e1\u7684\u7a0b\u5ea6. \\n\u5426\u5247\u7a0b\u5f0f\u7522\u51fa\u5feb\u901f, \u4f46\u5f8c\u7e8c\u9664\u932f\u7684\u529f\u592b, \u53ef\u80fd\u4e8b\u500d\u529f\u534a.\\n(\u4e5f\u8a31\u4e4b\u5f8c\u6703\u6709 AI debug \u670d\u52d9\u5427, \u7b11)\\n\\n\\nReferences\\n----------\\n\\n-   [\u5de5\u7a0b\u5e2b\u6b61\u547c\u5427\uff01\u5beb\u7a0b\u5f0f AI \u795e\u5668 GitHub Copilot \u6708\u79df\u8cbb\u53ea\u8981 120 | TechOrange \u79d1\u6280\u5831\u6a58](https://buzzorange.com/techorange/2022/06/22/github-copilot-ai-coding/)\\n    | [\u4e9e\u99ac\u905c\u4e5f\u63a8\u51fa\u4e86 AI \u5beb\u7a0b\u5f0f\u52a9\u624b CodeWhisperer\uff0c\u548c Github Copilot \u6709\u4f55\u4e0d\u540c\uff1f](https://buzzorange.com/techorange/2022/06/24/amazon-codewhisperer/)\\n    | [\u5de5\u7a0b\u5e2b\u6bba\u624b\u7d1a\u5de5\u5177\uff01\u4e00\u79d2\u81ea\u52d5\u88dc\u9f4a\u5f8c\u7e8c\u7a0b\u5f0f\u78bc\uff0c\u9084\u652f\u63f4 23 \u7a2e\u7a0b\u5f0f\u8a9e\u8a00](https://buzzorange.com/techorange/2019/08/02/nice-coding-tool/)\\n-   [\u5de5\u7a0b\u5e2b\u53ef\u4ee5\u5077\u61f6\u4e86\uff1fGithub\u53ef\u5e6b\u4f60\u5beb\u7a0b\u5f0f\u7684AI\u8f14\u52a9\u5de5\u5177Copilot\u4e0a\u7dda\uff0c\u6708\u8cbb\u53ea\u898110\u7f8e\u5143 | T\u5ba2\u90a6](https://www.techbang.com/posts/97357-github-launches-ai-tool-copilot-10-a-month-to-help-developers)\\n-   [GitHub Copilot \u5ba3\u4f48 GA \u2013 Gea-Suan Lin\'s BLOG](https://blog.gslin.org/archives/2022/06/23/10751/github-copilot-%e5%ae%a3%e4%bd%88-ga/)\\n    | [AWS \u4e5f\u63a8\u51fa\u4e86 GitHub Copilot \u7684\u7af6\u722d\u5c0d\u624b Amazon CodeWhisperer](https://blog.gslin.org/archives/2022/06/24/10755/aws-%e4%b9%9f%e6%8e%a8%e5%87%ba%e4%ba%86-github-copilot-%e7%9a%84%e7%ab%b6%e7%88%ad%e5%b0%8d%e6%89%8b-amazon-codewhisperer/)\\n    | [\u6e2c\u8a66 Neovim + GitHub Copilot](https://blog.gslin.org/archives/2022/06/24/10756/%e6%b8%ac%e8%a9%a6-neovim-github-copilot/)\\n-   [GitLab\u8207Tabnine\u5408\u4f5c\u5411\u958b\u767c\u8005\u63d0\u4f9bAI\u7a0b\u5f0f\u78bc\u5b8c\u6210\u529f\u80fd | iThome](https://www.ithome.com.tw/news/149710)"},{"id":"/2022/06/07/wwdc","metadata":{"permalink":"/moco/news/2022/06/07/wwdc","source":"@site/news/2022/06-07-wwdc.md","title":"WWDC 2022","description":"2022.06.07 WWDC 2022","date":"2022-06-07T00:00:00.000Z","formattedDate":"2022\u5e746\u67087\u65e5","tags":[{"label":"apple","permalink":"/moco/news/tags/apple"}],"readingTime":2.84,"hasTruncateMarker":false,"authors":[{"name":"kywk","title":"Site Maintainer","url":"https://github.io/kywk","imageURL":"https://github.com/kywk.png","key":"kywk"}],"frontMatter":{"title":"WWDC 2022","description":"2022.06.07 WWDC 2022","authors":"kywk","tags":["apple"],"image":"https://i.imgur.com/mErPwqL.png","hide_table_of_contents":true},"prevItem":{"title":"GitHub Copilot GA","permalink":"/moco/news/2022/06/24/github-copilot"},"nextItem":{"title":"The Future of the GitLab Web IDE","permalink":"/moco/news/2022/05/24/gitlab-web-ide"}},"content":"\u4e00\u5982\u5f80\u5e38\u860b\u679c\u958b\u767c\u8005\u5e74\u6703, WWDC \u4e3b\u8981\u8457\u91cd\u5728 OS \u65b9\u9762\u7684\u66f4\u65b0, \u6bd4\u8f03\u5c11\u786c\u9ad4\u76f8\u95dc\u767c\u8868.\\n\u800c\u5f9e 2020 \u4e00\u9cf4\u9a5a\u4eba\u7684 M1 \u8655\u7406\u5668\u9762\u4e16\u4e4b\u5f8c, \u860b\u679c\u5927\u578b\u767c\u8868\u6703\u5e7e\u4e4e\u90fd\u6709\u66f4\u5f37\u5927\u5f8c\u7e8c\u66f4\u65b0\u767c\u8868.\\n\u5f9e M1 Pro / M1 Max / M1 Ultra, \u9019\u6b21\u5247\u767c\u8868\u4e86 M2 \u8655\u7406\u5668.\\n\\n![](https://lh3.googleusercontent.com/pw/AM-JKLUS3s2ZxQ08lmQy9o2b_-rtk7MPtbtYUrqBuwbxn68l2ZjFZ92o-79qlA4Z7dJCy7vdag4QuiDw2tTyrDFiq1D_Y0YrsHbyQy5pRmiMDVeBixwV6f1WiKw8OQK7n1IPz-2IM0pmGcyhTqrO8ujAgENt8g=w730-no?authuser=0)\\n\\n\u6709\u8da3\u7684\u662f, \u5728\u5b98\u65b9\u767c\u8868\u7684\u8a0a\u606f\u770b\u4f86, M2 \u8655\u7406\u5668, \u9664\u4e86\u63a1\u7528\u65b0\u4e00\u4ee3\u7684 5nm \u88fd\u7a0b\u5916, \\n\u672c\u8cea\u67b6\u69cb\u4e0a\u4f3c\u4e4e\u662f\u548c M1 \u4e00\u6a23, \u7531 A14 \u9b54\u6539\u800c\u4f86\u7684\u7248\u672c. \\n\u671f\u5f85\u7684\u4ee5 A15 \u6838\u5fc3\u767c\u5c55\u800c\u4f86\u7684 M2 \u4f3c\u4e4e\u9084\u5728\u8def\u4e0a?\\n\\n\u66f4\u65b0: \u5f8c\u7e8c\u591a\u5bb6\u5a92\u9ad4\u7684\u8a55\u6e2c\u5206\u6790\u4f86\u770b, \u5927\u591a\u8a8d\u70ba M2 \u63a1\u7528\u7684\u61c9\u8a72\u662f A15 \u6838\u5fc3. \\n\u4e0d\u904e\u5b98\u65b9\u6c92\u6709\u6b63\u5f0f\u6d88\u606f, \u5148\u88dc\u5145\u5099\u8a18\u65bc\u6b64.\\n\\n\u904e\u53bb Intel CPU, \u4ee5\u67b6\u69cb\u548c\u88fd\u7a0b\u5404\u6bcf\u5169\u5e74\u4e00\u6b21\u91cd\u5927\u66f4\u65b0\u4ea4\u932f\u767c\u8868\u805e\u540d\u7684 Tick-Tock \u6230\u7565, \\n\u800c\u597d\u4e9b\u6642\u9593\u767c\u8868\u6548\u80fd\u53c8\u4e0d\u7b26\u5408\u671f\u5f85, \u88ab\u6232\u7a31\u70ba\u64e0\u7259\u818f.\\n\\nM2 \u76f8\u5c0d\u65bc M1 \u5df2\u6709\u5169\u5e74\u6642\u9593, \u9ad4\u8cea\u67b6\u69cb\u4e0a\u6c92\u6709\u6539\u8b8a, \u800c\u662f\u88fd\u7a0b\u7684\u6210\u9577\u5e36\u4f86\u4e86\u6548\u80fd\u63d0\u6607.\\n\u5169\u5e74\u4e4b\u5f8c\u7684\u6548\u80fd\u63d0\u6607\u4e86 18%, \u4f3c\u4e4e\u548c\u64e0\u7259\u818f\u6642\u671f\u7684 Intel \u5dee\u4e0d\u591a?\\n\u671f\u8a31 Apple \u5225\u8d70\u5411 Intel \u5f8c\u5875, \u671f\u5f85\u5e02\u5834\u4e0a\u6709\u591a\u6a23\u5404\u81ea\u7279\u8272\u7684\u7522\u54c1\u4f9b\u61c9\u9078\u64c7.\\n\\n![](https://lh3.googleusercontent.com/pw/AM-JKLW4veGa_SdcqdqW7DQ9GbTayruErPhiGYX5hKpWg806evFR3yu9TF_CFd3iJF3p9bATP_Cm8nMvgdx5YkOU7mpEdYzEsNApk3syao4KmDP1z3lKthY1o4gAKq5gBu_Mt_BFQP2WC2xm6S0iNuMHs7S-eQ=w730-no?authuser=0)\\n\\nWWDC 2022 \u4e0a\u53e6\u4e00\u500b\u65b0\u786c\u9ad4\u662f\u548c 2020 M1 \u4e00\u8d77\u767c\u8868\u7684 Macbook Air / Macbook Pro 13\\".\\n\u5176\u4e2d Macbook Pro 13\\" \u9664\u4e86 CPU \u5347\u7d1a\u5916, \u5176\u9918\u90fd\u548c M1 \u7248\u672c\u4e00\u6a23. \\n\u53ef\u4ee5\u770b\u5f97\u51fa\u4f86 MBP 13\\" \u6e96\u5099\u8d70\u5165\u6b77\u53f2\u4e86, \u7531 MBP 14\\" \u53d6\u4ee3.\\n\\n\u800c M2 Macbook Air \u5404\u9805\u8a2d\u8a08\u8a9e\u8a00\u4e5f\u548c MBP 14\\"/16\\" \u770b\u9f4a. \\n\u770b\u4f86\u6211\u6240\u4e0d\u559c\u6b61\u7684\u5916\u8868, \u6703\u662f\u672a\u4f86\u597d\u6bb5\u6642\u9593 Macbook \u7cfb\u5217\u7684\u7d71\u4e00\u9577\u76f8.\\n\u800c\u6211\u6700\u671f\u5f85\u7684 Macbook 12\\" \u4e26\u6c92\u6709\u5f8c\u7e8c\u6a5f\u7a2e\u7684\u6d88\u606f, \u770b\u4f86\u662f\u5fb9\u5e95\u8d70\u5165\u6b77\u53f2\u4e86.\\n\\n![](https://lh3.googleusercontent.com/pw/AM-JKLVAkugWj_CkFkerYIm4IO1hvSaasgKxKDWU17HYdPr8m1g8hdqoS6Ru7tCE_09ccaCdIoTAgdNlUeGVbnvTDmrYZk5mBA9hMGUufGYUHTKqD9f2lyxFhBoLNl2Hvo8xjhEAbhdeYCNL7XCr02saLTT6ag=w800-no?authuser=0)  \\n\\n![](https://lh3.googleusercontent.com/pw/AM-JKLVLlItlN1Y5DcqmH9Csjr-8XidI2xpGfl6Wl5hBTMzEq4E9FF3PNIq5OzcERMECrKri6DiYNX3Aoef09OHilmZ1otLnvQ8929iJ0hH2EJ7K_YO-MVIXCLtjDaSNnKzjJrlKrtO85E23ldvPSeK6WmVZTw=w800-no?authuser=0)\\n\\n\u800c WWDC \u4e0a\u4e3b\u8ef8\u7684\u8edf\u9ad4\u66f4\u65b0, \u4e00\u65b9\u4fbf\u89ba\u5f97 3C \u6574\u5408\u78ba\u5be6\u8d8a\u4f86\u8d8a\u65b9\u4fbf\u4e86.\\n\u624b\u6a5f / \u5e73\u677f / \u96fb\u8166\u7684\u5354\u540c\u5de5\u4f5c\u8d8a\u4f86\u8d8a\u7121\u7e2b\u929c\u63a5. \\n\\n\u4e0d\u904e\u860b\u679c\u81ea\u6210\u9ad4\u7cfb\u7684\u751f\u614b\u5708\u4f3c\u4e4e\u4e5f\u8d8a\u4f86\u8d8a\u6392\u5916, \\n\u8fd1\u5e74\u4f86\u8a31\u591a\u65b0\u529f\u80fd, \u5c0d\u65bc\u975e\u5b8c\u5168\u860b\u679c\u9ad4\u7cfb\u7684\u7528\u6236, \u662f\u5f88\u7121\u611f\u7684."},{"id":"/2022/05/24/gitlab-web-ide","metadata":{"permalink":"/moco/news/2022/05/24/gitlab-web-ide","source":"@site/news/2022/05-24-gitlab-web-ide.md","title":"The Future of the GitLab Web IDE","description":"2022.05.24 The Future of the GitLab Web IDE","date":"2022-05-24T00:00:00.000Z","formattedDate":"2022\u5e745\u670824\u65e5","tags":[{"label":"gitlab","permalink":"/moco/news/tags/gitlab"}],"readingTime":1.33,"hasTruncateMarker":true,"authors":[{"name":"kywk","title":"Site Maintainer","url":"https://github.io/kywk","imageURL":"https://github.com/kywk.png","key":"kywk"}],"frontMatter":{"title":"The Future of the GitLab Web IDE","description":"2022.05.24 The Future of the GitLab Web IDE","authors":"kywk","tags":["gitlab"],"image":"https://i.imgur.com/mErPwqL.png","hide_table_of_contents":true},"prevItem":{"title":"WWDC 2022","permalink":"/moco/news/2022/06/07/wwdc"},"nextItem":{"title":"Awesome Resources","permalink":"/moco/news/awesome"}},"content":"[GitLab \u767c\u8868\u65b0 WebIDE \u7684\u7279\u8272\u8207\u6574\u5408\u8aaa\u660e](https://about.gitlab.com/blog/2022/05/23/the-future-of-the-gitlab-web-ide/), \\n\u662f\u4ee5 VS Code \u6838\u5fc3\u5f15\u64ce [Monaco](https://microsoft.github.io/monaco-editor/)\\n\u958b\u767c\u6574\u5408\u800c\u4f86\u7684.\\n\\n\x3c!--truncate--\x3e\\n\\n> The Web IDE is built on top of the fantastic open source project, Monaco. \\n> What made Monaco a great choice as the foundation of the Web IDE \\n> is also what makes it more difficult to address all these concerns holistically. \\n> Monaco is just that: a foundation. We have to implement all these workflows \\n> and features ourselves. Meanwhile, another open source project has been \\n> laser-focused on delivering a lovable IDE on top of Monaco.\\n\\nVS Code \u78ba\u5be6\u662f Microsoft \u8fd1\u5e74\u4f86\u6700\u53d7\u6b61\u8fce\u80af\u5b9a\u7684\u7522\u54c1\u5c08\u6848. \\n\u4ee5 VS Code \u70ba\u57fa\u790e\u6574\u5408\u958b\u767c\u5176\u5be6\u5408\u7406. \u4f46\u56e0\u5fae\u8edf\u540c\u6642\u64c1\u6709 GitHub, \u6574\u4ef6\u4e8b\u8b8a\u5f97\u6709\u8da3.\\n\\n> It\'s interesting to me that GitLab is adopting a Microsoft product \\n> (VS Code) and Microsoft owns a significant competitor in GitHub. \\n> Nothing intelligent to say about that other than to wish \\n> I\'d been a fly on the wall for the discussions about that.\\n\\n[Hacker News](https://news.ycombinator.com/item?id=31487079)\\n\u4e0a\u8a31\u591a\u8a0e\u8ad6\u70ba\u4f55 GitHub \u8eab\u70ba GitLab \u6700\u5927\u7684\u5c0d\u624b, GitLab \u537b\u9078\u7528\u4e86\u5c0d\u624b\u6bcd\u516c\u53f8\u7684\u5c08\u6848\u4f5c\u70ba\u6838\u5fc3\u529f\u80fd.\\n\u9806\u4fbf\u628a\u66fe\u7d93\u88ab GitHub \u865f\u7a31\u7684 21 \u4e16\u7d00 IDE - [Atom](https://github.com/atom/atom) \u6293\u51fa\u4f86\u97ad\u5c4d\u4e00\u4e0b."},{"id":"/awesome","metadata":{"permalink":"/moco/news/awesome","source":"@site/news/awesome.md","title":"Awesome Resources","description":"This is News Clippins","date":"2022-05-20T00:00:00.000Z","formattedDate":"2022\u5e745\u670820\u65e5","tags":[{"label":"awesome","permalink":"/moco/news/tags/awesome"}],"readingTime":0.095,"hasTruncateMarker":true,"authors":[{"name":"kywk","title":"Site Maintainer","url":"https://github.io/kywk","imageURL":"https://github.com/kywk.png","key":"kywk"}],"frontMatter":{"title":"Awesome Resources","description":"This is News Clippins","date":"2022-05-20T00:00:00.000Z","authors":"kywk","tags":["awesome"],"image":"https://i.imgur.com/mErPwqL.png","hide_table_of_contents":false},"prevItem":{"title":"The Future of the GitLab Web IDE","permalink":"/moco/news/2022/05/24/gitlab-web-ide"}},"content":"\x3c!--truncate--\x3e\\n\\n## news & discus ##\\n\\n-   [Hacker News](https://news.ycombinator.com/)\\n-   [DEV Community \ud83d\udc69\u200d\ud83d\udcbb\ud83d\udc68\u200d\ud83d\udcbb](https://dev.to/)\\n-   [IT\u4eba](https://iter01.com/)\\n-   [MdEditor](https://www.gushiciku.cn/pl/)"}]}')}}]);